import { Link } from 'react-router-dom';

function Team ({ team, logo, city, name, details, founded, id }) {
  return (
    <Link to="/team" state={{ team }}>
      <img  src={logo} style={ { width: '150px' } } alt="League logo"/>
      {name} / {city}
      {/* {name} / {city} / {founded} / {id} / {details} */}
    </Link>
  );
}

Team.defaultProps = {
  team: {},
};

export default Team;
